import React from "react";
import styled from "styled-components";

const Wrapper = styled.section``;

const WrapperLogin = styled.div``;

const Cuenta = styled.p``;

const LinkLogin = styled.a``;

const ImageFooter = styled.img`
	height: auto;
	width: 100vw;
`;

const Home = () => {
	return <h1>Hola</h1>;
};

export default Home;
